import React from 'react';

import './App.css';

//notifiction 테스트용
const store = configureStore();
window.appStore = store;

//Home
class App extends React.Component {

  render() {
    return (
      <div className="App">
        <h1>Hello</h1>
      </div>
    )
  }
}

export default App;
